      let portfolio = result[0][0]

      //Get Trades
      result = await sequelize.query(`SELECT * FROM Trade WHERE portfolioId='${portfolio.portfolioid}';`)
      console.log(result[0])

      res.status(200).json({portfolio: portfolio, trades: result[0]})

    }catch(err){
      console.log(err);

      res.status(400).json({
